import React from 'react'
import './Checkbox.scss'

function Checkbox({ id }) {
   return (
      <div >
         <input id={id} className='checkbox' type="checkbox" />
         <label  htmlFor={id}>
            <img className='check-mark' src="/img/check.svg" alt="checkMark" />
         </label>
      </div>
   )
}

export default Checkbox
